import React, { useState, useEffect } from "react";
import axios from "axios";
import "./TaskList.css";

const API_URL = "http://localhost:8000/api/tasks/"; // ‚úÖ Ensure correct API route

const TaskList = () => {
  const [tasks, setTasks] = useState([]);
  const [newTask, setNewTask] = useState({
    title: "",
    description: "",
    date: "",
    time: "",
  });

  useEffect(() => {
    fetchTasks();
  }, []);

  // Fetch tasks from backend
  const fetchTasks = async () => {
    try {
      const response = await axios.get(API_URL);
      setTasks(response.data);
    } catch (error) {
      console.error("‚ùå Error fetching tasks:", error.response?.data || error);
    }
  };

  // Add a new task
  const addTask = async () => {
    if (!newTask.title || !newTask.date || !newTask.time) {
      alert("‚ö†Ô∏è Please fill in all required fields!");
      return;
    }
    try {
      await axios.post(
        API_URL,
        { ...newTask, completed: false },
        { headers: { "Content-Type": "application/json" } } // ‚úÖ Ensure JSON request
      );
      fetchTasks();
      setNewTask({ title: "", description: "", date: "", time: "" });
    } catch (error) {
      console.error("‚ùå Error adding task:", error.response?.data || error);
    }
  };

  // Toggle task completion status
  const toggleComplete = async (id, completed) => {
    try {
      await axios.patch(
        `${API_URL}${id}/`, // ‚úÖ Ensure proper URL formatting
        { completed: !completed },
        { headers: { "Content-Type": "application/json" } }
      );
      fetchTasks();
    } catch (error) {
      console.error("‚ùå Error updating task:", error.response?.data || error);
    }
  };

  // Delete a task
  const deleteTask = async (id) => {
    try {
      await axios.delete(`${API_URL}${id}/`); // ‚úÖ Ensure proper URL formatting
      fetchTasks();
    } catch (error) {
      console.error("‚ùå Error deleting task:", error.response?.data || error);
    }
  };

  return (
    <div className="task-container">
      <h2>‚úÖ Farmer's Task List</h2>

      {/* Task Input Section */}
      <div className="task-input">
        <input
          type="text"
          placeholder="Task Title"
          value={newTask.title}
          onChange={(e) => setNewTask({ ...newTask, title: e.target.value })}
        />
        <input
          type="text"
          placeholder="Description"
          value={newTask.description}
          onChange={(e) => setNewTask({ ...newTask, description: e.target.value })}
        />
        <input
          type="date"
          value={newTask.date}
          onChange={(e) => setNewTask({ ...newTask, date: e.target.value })}
        />
        <input
          type="time"
          value={newTask.time}
          onChange={(e) => setNewTask({ ...newTask, time: e.target.value })}
        />
        <button onClick={addTask}>‚ûï Add Task</button>
      </div>

      {/* Task List */}
      <ul className="task-list">
        {tasks.map((task, index) => (
          <li key={task.id || `task-${index}`} className={task.completed ? "completed" : ""}>
            <div>
              <h3>{task.title}</h3>
              <p>{task.description || "üìå No description provided."}</p>
              <p>üìÖ Date: {task.date}</p>
              <p>‚è∞ Time: {task.time}</p>
            </div>
            <div className="task-buttons">
              <button onClick={() => toggleComplete(task.id, task.completed)}>
                {task.completed ? "‚ùå Undo" : "‚úÖ Complete"}
              </button>
              <button onClick={() => deleteTask(task.id)}>üóë Delete</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TaskList;
